import './Buycar.css'




const Buycar = () => {
    const {value,setValue}=useContext(UserContext)
    return (
        <>
           <NavBar1 />
           <div>
                <div>
                    <CardsHome />
                </div>
           </div>
           Buy Car page
        </>
    )
}
export default Buycar
